import React from 'react';

const CalendarDate = ([day]) => {
    return(
        <div className='day rounded-[100px]'>
                        <div className='h-[70px]  '>
                            <div className='  w-[30px] h-[30px] rounded-full  m-auto mt-[5px]'>
                                {day.date}
                            </div>
                            
                        </div>
                        <div>
                            {day.name}  
                        </div>
                    </div>
    );
}

export default CalendarDate;
